import React, { Component } from "react";

class Index extends Component {
  constructor(props) {
    super(props);
  }
  static async getInitialProps(ctx) {
    const initialProps = await Document.getInitialProps(ctx);
    console.log("FETCHING DATA");
  }

  render() {
    return (
      <div>
        <h1>Our Index Page</h1>
      </div>
    );
  }
}

